import {Row,Col,Container} from 'react-bootstrap';

const AdminScreen = () => {
  return (
    <>
        <Row>
            <h1>Admin Panel</h1>
            <Col md={4}></Col>
            <Col md={4}></Col>
        </Row>
    </>
  );
};

export default AdminScreen;
